import React from 'react';
import { StyleSheet, TextInput, Picker, Text, TouchableOpacity } from "react-native";
import { DateTimePickerComponent } from '@syncfusion/ej2-react-calendars';
import './App.css';

function App() {
  const [selectedLanguage, setSelectedLanguage] = React.useState();
  const dateValue: Date = new Date();

  return (
    <div className="App" style={{ padding: 20 }}>
      <Text style={styles.titletext}>COVID Timeline Genetator</Text>
      <div className="App-page">

        <div className="inputData">
          <div className="inputpadding" style={{ padding: 10, borderRadius: 5, }}>
            <h1 style={{ color: '#27a742' }}>ข้อมูลผู้ป่วย</h1>

            <span>
              <h2>เพศ</h2>
              <Picker style={styles.picker}>
                <Picker.Item label="ชาย" value="man" />
                <Picker.Item label="หญิง" value="woman" />
              </Picker>
              <h2>อายุ</h2>
              <TextInput
                style={styles.textinput}
              />
            </span>

            <h2>อาชีพ</h2>
            <TextInput
              style={styles.textinput}
            />
          </div>

          <div className="inputpadding" style={{ padding: 10, borderRadius: 5, }}>
            <h1 style={{ color: '#27a742' }}>ข้อมูลไทม์ไลน์</h1>
            <h2>วันเวลา</h2>
            <DateTimePickerComponent
            style={styles.datespicker}
              value={dateValue}/>

            <h2>รายละเอียด</h2>
            <TextInput
              style={styles.textinput}
            />

            <TouchableOpacity
              onPress={() => console.log('click button')}
              style={styles.button}
            >+ เพิ่มข้อมูล
            </TouchableOpacity>
          </div>
        </div>

        <div className="showData">
          <h1>test</h1>
        </div>
      </div>
    </div >
  );
}

const styles = StyleSheet.create({
  button: {
    alignItems: "center",
    color: '#012d5e',
    backgroundColor: '#ffc107',
    padding: 5,
    borderRadius: 5,
    fontFamily: 'Prompt',
    margin: 10
  },

  titletext: {
    fontFamily: 'Prompt',
    fontSize: 28,
    color: '#ffc107',
  },

  picker: {
    fontFamily: 'Prompt',
    fontSize: 16,
  },

  datespicker: {
    fontFamily: 'Prompt',
    fontSize: 16,
    backgroundColor: '#fff',
  },

  textinput: {
    fontFamily: 'Prompt',
    fontSize: 16,
    height: 40,
    padding: 5,
    borderRadius: 5,
    backgroundColor: "#fff"
  }
});

export default App;
